contract VPunkStakingV1 is Ownable, Pausable {
    // using SafeMath for uint256;
    // using SafeERC20 for IERC20;
    using EnumerableSet for EnumerableSet.UintSet;

    struct StakingPool {
        uint256 startedAt; // (seconds)
        uint128 totalCommitReward; // total commitment reward (wei)
        uint128 minPerPunk; // (wei)
        uint128 maxPerPunk; // (wei)
        uint128 tierStep; // (wei)
        uint16 rewardRate; // ex: 200 = 20%/year (max-value: 65535)
        uint16 maxDuration; // hours (max-value: 65535)
    }

    struct StakingPoolDeep {
        uint128 totalStake; // (wei)
        uint128 totalRewardPayable; // tng s phn thng phi tr (wei)
        uint128 totalRewardWithdrawn; // tng s phn thng ngi dng  rt (wei)
        uint128 stakeCount; // id
        bool isPaused; // cho php create hay update
    }

    struct StakeHolder {
        uint256 tokenId;
        uint256 startedAt; // (seconds)
        uint128 stakeAmount; // (wei)
        uint128 rewardStored; // s phn thng ngi dng nhn c (wei)
        uint128 rewardWithdrawn; // s phn thng ngi dng  rt (wei)
        uint16 duration; // hours
        address account;
        bool linkToNFT;
    }

    struct TokenIdStakeInfo {
        uint16 poolId;
        uint128 stakeId;
    }

    /* ========== STATE VARIABLES ========== */

    IVPunks public vpunksContract;
    IERC20 public stakingToken;
    
    // public
    address[] public auctionContractList;
    uint16 public minDuration = 1; // hours (max-value: 65535)
    // private
    uint256 public totalStakingSupply; // ton b lng staking trong tt c cc pool cng li

    // StakingPool
    mapping (uint16 => StakingPool) public stakingPools; // poolId -> StakingPool
    mapping (uint16 => StakingPoolDeep) public stakingPoolDeeps; // poolId -> StakingPoolDeep
    EnumerableSet.UintSet private _stakingPoolIds; // poolId Array
    
    // StakeHolder
    mapping (uint16 => mapping (uint128 => StakeHolder)) public stakeHolders; // poolId -> stakeId -> StakeHolder
    // mapping (uint16 => EnumerableSet.UintSet) private _stakeHolderIds; // poolId -> StakeHolderId Array
    mapping (address => mapping (uint16 => EnumerableSet.UintSet)) private _accountStakeHolderIds; // account -> poolId -> StakeHolderId Array
    //
    mapping (uint256 => TokenIdStakeInfo) public tokenIdToStakeInfo;

    /* ========== CONSTRUCTOR ========== */
    constructor(address _vpunksAddress, address _stakingToken) {
        vpunksContract = IVPunks(_vpunksAddress);
        stakingToken = IERC20(_stakingToken);
    }
    

    /* ========== Read Contract ========== */
    /*
    // @
