    // @
    function checkPoolIsActive(uint16 _poolId) public view returns (bool) {
        if (stakingPoolDeeps[_poolId].isPaused) return false;
        if (stakingPools[_poolId].startedAt == 0 || block.timestamp < stakingPools[_poolId].startedAt) return false;
        return true;
    }
