    // @ for VeChain connex v1
    function stakingPoolById(uint16 _id) external view returns (uint256, uint128, uint128, uint128, uint128, uint16, uint16) {
        StakingPool memory sp = stakingPools[_id];
        return (
            sp.startedAt,
            sp.totalCommitReward,
            sp.minPerPunk,
            sp.maxPerPunk,
            sp.tierStep,
            sp.rewardRate,
            sp.maxDuration
        );
    }
    // @ for VeChain connex v1
    function stakingPoolDeepById(uint16 _id) external view returns (uint128, uint128, uint128, uint128, bool) {
        StakingPoolDeep memory sd = stakingPoolDeeps[_id];
        return (
            sd.totalStake,
            sd.totalRewardPayable,
            sd.totalRewardWithdrawn,
            sd.stakeCount,
            sd.isPaused
        );
    }
    // end Tng tc vi StakingPool ----------------------------------

    // Tng tc vi StakeHolder ----------------------------------
    // @
    function totalStakeInPoolOf(address _account, uint16 _poolId) external view returns (uint256) {
        return _accountStakeHolderIds[_account][_poolId].length();
    }
    // @
    function stakeIdInPoolByIndexOf(address _account, uint16 _poolId, uint256 _index) external view returns (uint256) {
        return _accountStakeHolderIds[_account][_poolId].at(_index);
    }
    // @ for VeChain connex v1
    function stakeInPoolByStakeId(uint16 _poolId, uint128 _stakeId) external view returns (
        uint256,
        uint256,
        uint128,
        uint128,
        uint128,
        uint16,
        address,
        bool
    ) {
        StakeHolder memory sh = stakeHolders[_poolId][_stakeId];
        return (
            sh.tokenId,
            sh.startedAt,
            sh.stakeAmount,
            sh.rewardStored,
            sh.rewardWithdrawn,
            sh.duration,
            sh.account,
            sh.linkToNFT
        );
    }
