    // @
    function stakeByTokenId(uint256 _tokenId) external view returns (
        uint256,
        uint256,
        uint128,
        uint128,
        uint128,
        uint16,
        address,
        bool
    ) {
        TokenIdStakeInfo memory tsi = tokenIdToStakeInfo[_tokenId];
        StakeHolder memory sh = stakeHolders[tsi.poolId][tsi.stakeId];
        return (
            sh.tokenId,
            sh.startedAt,
            sh.stakeAmount,
            sh.rewardStored,
            sh.rewardWithdrawn,
            sh.duration,
            sh.account,
            sh.linkToNFT
        );
    }
    
    // @
    function accessToStakeByStakeId(address _account, uint16 _poolId, uint128 _stakeId) public view returns (bool) {
        StakeHolder memory sh = stakeHolders[_poolId][_stakeId];
        bool isOwned = isOwnedTokenId(sh.tokenId, _account);
        if (isOwned && (sh.account == _account || sh.linkToNFT)) return true; // _account ny s hu _tokenId v to ra stakeHolders ny hoc stakeHolders linkToNFT
        if (!isOwned && sh.account == _account && !sh.linkToNFT) return true; // _account ny k s hu _tokenId nhng to ra stakeHolders ny v khng linkToNFT
        return false;
    }
    /* tit kim gas
    // @
    function accessToStakeByIndex(address _account, uint16 _poolId, uint256 _index) public view returns (bool) {
        uint256 stakeId = _accountStakeHolderIds[_account][_poolId].at(_index);
        require(stakeId < 2**128);
        return accessToStakeByStakeId(_account, _poolId, uint128(stakeId));
