    */
    // end Tng tc vi StakeHolder ----------------------------------

    // @
    function rewardCalculation(uint16 _rewardRate, uint128 _amount, uint16 _hours) public pure returns (uint128) {
        return (_amount * _rewardRate * _hours * 1 hours / (1 days * 365) / 1000);
    }

    // @ kim tra _tokenId (ca bt k ai) c ang trong stake ca _account khng (owned phi kim tra ring)
    function tokenIdInMyStake(uint256 _tokenId, address _account, bool _ownedToken) public view returns (bool) {
        TokenIdStakeInfo memory tsi = tokenIdToStakeInfo[_tokenId];
        if (tsi.poolId == 0) return false; // khng c stakeHolders ca _tokenId ny
        StakeHolder memory sh = stakeHolders[tsi.poolId][tsi.stakeId];
        if (_ownedToken && (sh.account == _account || sh.linkToNFT)) return true; // _account ny s hu _tokenId v to ra stakeHolders ny hoc stakeHolders linkToNFT
        if (!_ownedToken && sh.account == _account && !sh.linkToNFT) return true; // _account ny k s hu _tokenId nhng to ra stakeHolders ny v khng linkToNFT
        return false;
    }

    // @ check isOwnedTokenId (can Create || Update stake)
    function isOwnedTokenId(uint256 _tokenId, address _account) public view returns (bool) {
        try vpunksContract.ownerOf(_tokenId) {
            address owner = vpunksContract.ownerOf(_tokenId);
            if (owner == _account) return true;
        } catch {
        }
        bool result = false;
        for (uint i = 0; i < auctionContractList.length; i++) {
            IAuction auctionAccount = IAuction(auctionContractList[i]);
            // (address a, uint256 b, uint256 c, uint128 d, uint128 e, uint64 f, bool g) = auctionAccount.auctionByTokenId(_tokenId);
            try auctionAccount.auctionByTokenId(_tokenId) {
                (address a) = auctionAccount.auctionByTokenId(_tokenId);
                if (a == _account) {
                    result = true;
                    break;
                }
            } catch {
            }
        }
        return result;
    }
    /* ========== end Read Contract ========== */


    /* ========== Write Contract ========== */
    /* khng dng  tit kim gas
    function stakeWithPermit(uint256 amount, uint deadline, uint8 v, bytes32 r, bytes32 s) external nonReentrant whenNotPaused {
