    // @
    function stake(uint256 _tokenId, uint16 _poolId, uint128 _amount, uint16 _hours, bool _link) external whenNotPaused {
        require(checkPoolIsActive(_poolId), "E1"); // E1 = Staking pool not ready
        bool isOwned = isOwnedTokenId(_tokenId, msg.sender);
        require(isOwned, "E2"); // E2 = Invalid tokenId
        require(!tokenIdInMyStake(_tokenId, msg.sender, isOwned), "E3"); // E3 = tokenId have been staked
        
        StakingPool memory sPool = stakingPools[_poolId];
        require(_amount >= sPool.minPerPunk && _amount <= sPool.maxPerPunk, "E4"); // E4 = Invalid amount
        
        uint16 duration = _hours < minDuration ? minDuration : (_hours > sPool.maxDuration ? sPool.maxDuration : _hours);
        uint128 rewardCal = rewardCalculation(sPool.rewardRate, _amount, duration);
        StakingPoolDeep storage spDeep = stakingPoolDeeps[_poolId];
        require(spDeep.totalRewardPayable + rewardCal <= sPool.totalCommitReward, "E5"); // E5 = exceed pool commit reward
        stakingToken.transferFrom(msg.sender, address(this), _amount);

        // add StakeHolder
        stakeHolders[_poolId][spDeep.stakeCount] = StakeHolder({
            tokenId: _tokenId,
            startedAt: block.timestamp,
            stakeAmount: _amount,
            rewardStored: rewardCal,
            rewardWithdrawn: 0,
            duration: duration,
            account: msg.sender,
            linkToNFT: _link
        });
        // add StakeInfo ca tokenId
        tokenIdToStakeInfo[_tokenId] = TokenIdStakeInfo({
            poolId: _poolId,
            stakeId: spDeep.stakeCount
        });
        //
        // _stakeHolderIds[_poolId].add(spDeep.stakeCount);
        _accountStakeHolderIds[msg.sender][_poolId].add(spDeep.stakeCount);
        // update stakingPoolDeeps
        spDeep.totalStake += _amount;
        spDeep.totalRewardPayable += rewardCal;
        spDeep.stakeCount += 1;
        
        // update contract variable
        totalStakingSupply += _amount;
        emit Staked(msg.sender, _tokenId, _poolId, _amount);
    }
    
    // @ add _amount to stake
    function addStake(uint256 _tokenId, uint16 _poolId, uint128 _amount) external whenNotPaused {
        require(checkPoolIsActive(_poolId), "E1"); // E1 = Staking pool not ready
        bool isOwned = isOwnedTokenId(_tokenId, msg.sender);
        require(isOwned, "E2"); // E2 = Invalid tokenId
        require(tokenIdInMyStake(_tokenId, msg.sender, isOwned), "E6"); // E3 = tokenId has not been staked
        
        StakingPool memory sPool = stakingPools[_poolId];
        TokenIdStakeInfo memory tsi = tokenIdToStakeInfo[_tokenId];
        require(tsi.poolId == _poolId, "E7");
        StakeHolder storage sh = stakeHolders[tsi.poolId][tsi.stakeId];
        require(sh.startedAt > 0, "E8");
        require(sh.stakeAmount + _amount <= sPool.maxPerPunk, "E4"); // E4 = Invalid amount
        
        uint256 endTime = sh.startedAt + (sh.duration * 1 hours);
        require (block.timestamp < endTime, "E11");
        uint256 remainingDuration = endTime - block.timestamp;
        uint128 rewardCal = _amount * sPool.rewardRate * uint128(remainingDuration) / (1 days * 365) / 1000;
        
        StakingPoolDeep storage spDeep = stakingPoolDeeps[_poolId];
        require(spDeep.totalRewardPayable + rewardCal <= sPool.totalCommitReward, "E5"); // E5 = exceed pool commit reward
        
        // update StakeHolder
        sh.stakeAmount += _amount;
        sh.rewardStored += rewardCal;
        // update stakingPoolDeeps
        spDeep.totalStake += _amount;
        spDeep.totalRewardPayable += rewardCal;
        //
        stakingToken.transferFrom(msg.sender, address(this), _amount);
        // update contract variable
        totalStakingSupply += _amount;
        emit StakeUpdated(msg.sender, _tokenId, _poolId, _amount);
    }
    
    // @
    function withdrawStake(uint16 _poolId, uint128 _stakeId) private whenNotPaused {
        StakeHolder memory sh = stakeHolders[_poolId][_stakeId];
        uint256 endTime = sh.startedAt + (sh.duration * 1 hours);
        require(block.timestamp >= endTime, "E9");
        
        // _stakeHolderIds[_poolId].remove(_stakeId);
        _accountStakeHolderIds[msg.sender][_poolId].remove(_stakeId);
        tokenIdToStakeInfo[sh.tokenId].poolId = 0;
        StakingPoolDeep storage spDeep = stakingPoolDeeps[_poolId];
        spDeep.totalStake -= sh.stakeAmount;
        
        if (totalStakingSupply > sh.stakeAmount) totalStakingSupply -= sh.stakeAmount;
        stakingToken.transfer(msg.sender, sh.stakeAmount);
        emit Withdrawn(msg.sender, sh.tokenId, _poolId, sh.stakeAmount);
        delete stakeHolders[_poolId][_stakeId];
    }
    /* tit kim gas
    // @
    function claimRewardByIndex(uint16 _poolId, uint256 _index) public {
        uint256 stakeId = _accountStakeHolderIds[msg.sender][_poolId].at(_index);
