    // @
    function claimRewardByStakeId(uint16 _poolId, uint128 _stakeId) public whenNotPaused {
        StakeHolder storage sh = stakeHolders[_poolId][_stakeId];
        bool isOwned = isOwnedTokenId(sh.tokenId, msg.sender);
        if (isOwned && (sh.account == msg.sender || sh.linkToNFT)) {
            uint128 remainingReward = 0;
            uint256 endTime = sh.startedAt + (sh.duration * 1 hours);
            if (block.timestamp < endTime) {
                uint256 remainingDuration = endTime - block.timestamp;
                uint16 rewardRate = stakingPools[_poolId].rewardRate;
                remainingReward = sh.stakeAmount * rewardRate * uint128(remainingDuration) / (1 days * 365) / 1000;
            }
            if (sh.rewardStored > remainingReward && sh.rewardStored - remainingReward > sh.rewardWithdrawn) {
                uint128 canClaimAmount = sh.rewardStored - (remainingReward + sh.rewardWithdrawn);
                sh.rewardWithdrawn += canClaimAmount;
                stakingPoolDeeps[_poolId].totalRewardWithdrawn += canClaimAmount;
                stakingToken.transfer(msg.sender, canClaimAmount);
                emit RewardPaid(msg.sender, sh.tokenId, _poolId, canClaimAmount);
            }
        }
    }
    /* tit kim gas
    // @
    function exitByIndex(uint16 _poolId, uint256 _index) external {
        uint256 stakeId = _accountStakeHolderIds[msg.sender][_poolId].at(_index);
        require(accessToStakeByStakeId(msg.sender, _poolId, uint128(stakeId)), "E10");
        claimRewardByStakeId(_poolId, uint128(stakeId));
        withdrawStake(_poolId, uint128(stakeId));
    }*/
    // @
    function exitByStakeId(uint16 _poolId, uint128 _stakeId) external {
        require(accessToStakeByStakeId(msg.sender, _poolId, _stakeId), "E10");
        claimRewardByStakeId(_poolId, _stakeId);
        withdrawStake(_poolId, _stakeId);
    }
    /* ========== end Write Contract ========== */


    /* ========== onlyOwner Write Contract ========== */
    // @
    function addAuctionContract(address _account, uint256 _index) public onlyOwner {
        if (_index >= auctionContractList.length) {
            auctionContractList.push(_account);
        } else {
            auctionContractList[_index] = _account;
        }
    }
    // @
    function createStakingPool(uint16 _poolId, uint256 _startedAt, uint128 _commitReward, uint128 _minPerPunk,
        uint128 _maxPerPunk, uint128 _tierStep, uint16 _rewardRate, uint16 _maxDuration
    ) public onlyOwner {
        if (stakingPools[_poolId].startedAt == 0) {
            // create
            _stakingPoolIds.add(_poolId);
        } 
        stakingPools[_poolId] = StakingPool({
            startedAt: _startedAt > block.timestamp ? _startedAt : block.timestamp,
            totalCommitReward: uint128(_commitReward),
            minPerPunk: uint128(_minPerPunk),
            maxPerPunk: uint128(_maxPerPunk),
            tierStep: uint128(_tierStep),
            rewardRate: uint16(_rewardRate),
            maxDuration: uint16(_maxDuration)
        });
    }
    // @
    function addRewardToPool(uint16 _poolId, uint128 _amount) public onlyOwner {
        require (stakingPools[_poolId].startedAt > 0);
        stakingPools[_poolId].totalCommitReward += _amount;
    }
    // @
    function setPoolPause(uint16 _poolId, bool _pause) public onlyOwner {
        stakingPoolDeeps[_poolId].isPaused = _pause;
    }
    // @
    function updateMinDuration(uint16 _hours) public onlyOwner {
        minDuration = _hours;
    }
    /* tit kim gas
