        stakingPools[_poolId] = StakingPool({
            startedAt: _input.startedAt > block.timestamp ? _input.startedAt : block.timestamp,
            totalCommitReward: uint128(_input.totalCommitReward),
            minPerPunk: uint128(_input.minPerPunk),
            maxPerPunk: uint128(_input.maxPerPunk),
            tierStep: uint128(_input.tierStep),
            rewardRate: uint16(_input.rewardRate),
            maxDuration: uint16(_input.maxDuration)
        });
    }*/
