    /* ========== EVENTS ========== */
    // event RewardAdded(uint128 amount);
    event Staked(address indexed user, uint256 indexed tokenId, uint16 poolId, uint128 amount);
    event StakeUpdated(address indexed user, uint256 indexed tokenId, uint16 poolId, uint128 amount);
    event Withdrawn(address indexed user, uint256 indexed tokenId, uint16 poolId, uint128 amount);
    event RewardPaid(address indexed user, uint256 indexed tokenId, uint16 poolId, uint128 amount);
}
